import './styles.css';

const Navbar = () => {
  return (
    <nav className="admin-nav-container">
      <ul>
        <li>
          <a href='link'></a>
          <p>Produtos</p>
        </li>
        <li>
          <p>Categorias</p>
        </li>
        <li>
          <p>Usuarios</p>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
